import React from 'react';
import CosForm from '../../form/CosForm'; // Ensure the path is correct
import Logo2 from '../../../assets/Logo2.png';

const Login = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
  };

  return (
    <CosForm title="Login" onSubmit={handleSubmit}>
      <div className="text-center mb-6">
        <img src={Logo2} alt="Logo" className="h-28 w-32 mx-auto" />
      </div>
      <div>
        <label className="block text-white" htmlFor="username">Username</label>
        <input 
          type="text" 
          id="username" 
          name="username" 
          className="w-full px-4 py-2 mt-2 border rounded-md focus:outline-none focus:ring-1 focus:ring-purple-600" 
          placeholder="Enter your username"
          autocomplete="username"
        />
      </div>
      <div className="mt-4">
        <label className="block text-white" htmlFor="password">Password</label>
        <input 
          type="password" 
          id="password" 
          name="password" 
          className="w-full px-4 py-2 mt-2 border rounded-md focus:outline-none focus:ring-1 focus:ring-purple-600" 
          placeholder="Enter your password"
          autoComplete="current-password"
        />
      </div>
      <button type="submit" className="px-4 py-2 bg-blue-800 text-white rounded-md mt-4">Log In</button>
      <div className="flex flex-col items-center mt-4">
        <p className="mt-4 text-sm text-white">Lupa Password?</p>
        <a href="/ForgetPass" className="text-blue-600">Reset Password</a>  
      </div>    
    </CosForm>
  );
};

export default Login;
